import Grid from "@mui/material/Grid";
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
import Card from "@mui/material/Card";
import 'bootstrap/dist/css/bootstrap.min.css';
import Footer from "examples/Footer";
// import { Link } from "react-router-dom";
import DataTable from "examples/Tables/DataTable";
import userswisetable from "layouts/authentication/error/userswisetable";
import ComplexReportsDoughnutChart from "examples/Charts/DoughnutCharts/ComplexReportsDoughnutChart";
import SuiBadgeDot from "components/SuiBadgeDot";
import PieChart from "examples/Charts/PieChart"
// Data
import channelChartData from "layouts/ecommerce/overview/components/ChannelsChart/data";
import complexReportsDoughnutChartData from "layouts/applications/analytics/data/complexReportsDoughnutChartData";

function Charts() {

  return (

    <DashboardLayout>
      <DashboardNavbar />

      <SuiBox p={2}>
        <Card id="profile">
          <SuiBox p={3}>

          <Card id="change-password">
          <SuiBox p={3}>
            <DataTable table={userswisetable} entriesPerPage={false} canSearch />
          </SuiBox>
        </Card>
            <Grid container spacing={3} alignItems="center">
              <Grid item>
                <SuiBox height="100%" mt={0.5} lineHeight={1}>
                  <SuiTypography variant="h5" fontWeight="medium">
                    AUM (User Wise)
                    <a href="/holding/ amcwiseaum" style={{ marginLeft: "40px" }}>AUM (AMC Wise)</a>
                    <a href="/holding/ schemety.peamc" style={{ marginLeft: "40px" }}> AUM (Scheme Type Wise)</a>

                    <a href="/holding/ schemewise" style={{ marginLeft: "40px" }}> AUM (Scheme Wise)  </a>

                    <a href="/holding/ userwiseaum" style={{ marginLeft: "40px" }}> AUM (RTA wise) </a>
                  </SuiTypography>
                </SuiBox>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>
      </SuiBox>


      <SuiBox p={2}>
        <Card id="change-password">
          <SuiBox p={3}>
            <DataTable table={userswisetable} entriesPerPage={false} canSearch />
          </SuiBox>
        </Card>
      </SuiBox>

      <SuiBox p={2} pb={3} px={3}>
        <Card id="change-password">
          <SuiBox p={3}>
            <Grid container spacing={3}>

              <Grid item xs={12} sm={15}>
                <ComplexReportsDoughnutChart
                  title="Referrals"
                  chart={complexReportsDoughnutChartData}
                  tooltip="See which websites are sending traffic to your website"
                  action={{
                    type: "internal",
                    route: "/",
                    color: "secondary",
                    label: "see all referrals",
                  }}
                />
              </Grid>
            </Grid>

            <Grid item xs={7}>
            <PieChart chart={channelChartData} height="100%" />
          </Grid>
          <Grid item xs={5}>
            <SuiBox px={1}>
              <SuiBox mb={0.5}>
                <SuiBadgeDot color="info" badgeContent="Facebook" />
              </SuiBox>
              <SuiBox mb={0.5}>
                <SuiBadgeDot color="primary" badgeContent="Direct" />
              </SuiBox>
              <SuiBox mb={0.5}>
                <SuiBadgeDot color="dark" badgeContent="Organic" />
              </SuiBox>
              <SuiBox mb={0.5}>
                <SuiBadgeDot color="secondary" badgeContent="Referral" />
              </SuiBox>
            </SuiBox>
          </Grid>
          </SuiBox>
        </Card>
      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Charts;
